(233, 1, '2018-06-27 09:59:24', '2018-06-27 12:59:24', 'Os Gadgets chegaram com tudo na vida dos atletas para auxiliar a prática das atividades físicas, acompanhar o desempenho, ajudar no acompanhamento da nossa saúde sem atrapalhar ou fazer algum peso desnecessário que atrapalhe a prática de atividades.\r\nA AtletasNow quer que você esteja sempre em alto nível, então separamos uma lista de aparelhos que podem te ajudar:\r\n\r\n<strong>  </strong>\r\n\r\n<strong>SmartWhatch: </strong>\r\n\r\nApple, Samsung, Sony e outras gigantes do segmento possuem relógios capazes de monitor seus batimentos cardíacos, GPS, podem marcar a distância percorrida ao longo da atividade, quantidade de calorias perdidas e podem monitora a quantidade de calorias perdidas. Além, claro, da conectividade com seu celular e com Apps de outras marcas.\r\n\r\n<strong>\r\nBraçadeira Esportiva:\r\n\r\n</strong>Se você opta apenas por seu Smartphone e fones para te acompanharem ao longo do exercício, esse equipamento pode ser uma boa edição para você. A braçadeira posso ajuste uma alça ajustável, protege seu aparelho, possuem porta fones nas laterais e fácil acesso para tela inicial do aparelho.\r\n\r\n\r\n<strong>SmartBands:\r\n\r\n\r\n</strong>Pode não parecer, mas elas são diferentes dos SmartWatches citados acima. Diferente dos relógios, elas foram desenvolvidas diretamente para o mundo Fitness não possuindo um visor para atender chamadas ou responder mensagens. Suas funções ficam direcionadas para o monitoramento, possuem uma bateria mais duradoura e custo benefício mais acessível.\r\n\r\n\r\n<strong>Fone de ouvido via Bluetooth: </strong>\r\n\r\n<strong> </strong>\r\n\r\nA música não pode ficar fora da sua atividade e você já deve saber qual o ritmo certo para te acompanhar. Geralmente os fones comuns não possuem um Design voltado à prática de exercícios físicos podendo atrapalhar em certos momentos. A melhor solução é optar por fones com tecnologia Bluetooth desenvolvidos para auxiliar atletas. JBL, Samsung, Pulse, Phillips são marcas que possuem essa linha de produtos com funções interessantes como isolamento de ruído, resistência ao suor, materiais resistentes e de alta qualidade.\r\n\r\n\r\nVocê já utilizou algum desses equipamentos ou gostaria de recomendar algum? Conte para nós qual seu favorito e como ele te ajuda na sua rotina de exercícios. Fale conosco através das nossas redes sociais!\r\n\r\n<strong> </strong>\r\n\r\n<strong> </strong>', 'Os melhores gadgets para te auxiliar na sua rotina de exercícios.', '', 'publish', 'closed', 'closed', '', 'os-melhores-gadgets-para-te-auxiliar-na-sua-rotina-de-exercicios', '', '', '2018-06-27 09:59:24', '2018-06-27 12:59:24', '', 0, 'https://atletasnow.com/?post_type=aprenda&#038;p=233', 0, 'aprenda', '', 0),
(234, 1, '2018-06-27 10:03:51', '2018-06-27 13:03:51', 'Entre os grandes eventos esportivos do mundo, temos as paraolimpíadas que são um sucesso em todas as edições com atletas competindo no seu mais alto nível e cheios de orgulho em representar seu país ao longo da competição.\r\n\r\nAntes de se firmar como uma competição, a história dos jogos começa em 1943, na pequena cidade Inglesa Stoke Mandeville, quando o neurologista Ludwig Guttman recebeu a importante missão de reabilitar soldados que vieram da Segunda Guerra Mundial. Como uma solução para ajudar esses soldados, Guttman montou um tratamento que uniu trabalho com esportes como basquetebol, tiro com arco, dardo e bilhar.\r\n\r\nEm 1948, ele promoveu o primeiro evento esportivo voltado para portadores deficiência após o sucesso do tratamento. Os jogos voltados para esses atletas continuaram todos os anos seguintes se tornando um evento internacional no ano de 1952.\r\n\r\nEm 1960, na cidade de Roma, ocorreram os primeiros jogos no estilo olímpico para atletas com deficiência.\r\nAtualmente, a competição representa uma disputa com atletas do mais alto nível competindo em 23 modalidades.\r\n\r\n&nbsp;\r\n\r\nCom todo esse potencial esportivo, nós da Atletas Now, não podíamos ficar de fora! Para isso, estamos cada vez querendo adicionar mais e mais esportes, desse modo os esportes paraolímpicos já estão sendo desenvolvidos para ser englobados em nossa rede!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA', 'História dos jogos Paraolímpicos', '', 'publish', 'closed', 'closed', '', 'historia-dos-jogos-paraolimpicos', '', '', '2018-06-27 10:03:51', '2018-06-27 13:03:51', '', 0, 'https://atletasnow.com/?post_type=aprenda&#038;p=234', 0, 'aprenda', '', 0),
