(239, 1, '2018-06-27 10:09:24', '2018-06-27 13:09:24', '<p style=\"text-align: left;\"><strong>Guilherme Paraense:\r\n</strong>\r\nVocê conhece a história do atleta Guilherme Paraense?</p>\r\n<p style=\"text-align: left;\">Talvez esse nome seja desconhecido para você, mas Guilherme foi o primeiro brasileiro a conquistar uma medalha de ouro para nosso país.</p>\r\n<p style=\"text-align: left;\">O atleta nasceu em Belém do Pará, no dia 25 de junho de 1884. Com apenas 5 anos de idade, foi para o Rio de Janeiro e começou a frequentar a Escola Militar de Realengo.</p>\r\n<p style=\"text-align: left;\">O tiro estava entre os exercícios exigidos nas suas atividades como militar e sempre teve facilidade nesse exercício acertando alvos de diferentes formatos e tamanhos.</p>\r\n<p style=\"text-align: left;\">\r\nSeu talento lhe rendeu o campeonato Brasileiro e Sulamericano na modalidade tiro com revolver.\r\nEm 1920, a delegação viajou até Bruxelas para competirem nos jogos daquele ano. A prova consistia em 30 tiros a uma distância de 30 metrôs do alvo e Guilherme acertou os três últimos que foram determinantes para a decisão. Paraense fez 274 pontos de 300, faturando, pela primeira vez, o lugar mais alto do pódio para nosso país.</p>\r\n<p style=\"text-align: left;\">Se hoje nosso país possui uma safra de campeões, Guilherme Paraense teve uma grande contribuição para o início da nossa história como campeões.</p>\r\n&nbsp;\r\n\r\nAssim como Guilherme no passado, muitos atletas atualmente sofrem com a mesma falta de atenção de divulgação e mídia. Atletas Now chegou para mudar essa realidade e ajudar a explorar o inexplorado!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;\r\n<p style=\"text-align: left;\"></p>', 'Pouca Mídia, Muito Talento!', '', 'publish', 'closed', 'closed', '', 'pouca-midia-muito-talento', '', '', '2018-07-04 16:27:32', '2018-07-04 19:27:32', '', 0, 'https://atletasnow.com/?post_type=aprenda&#038;p=239', 0, 'aprenda', '', 0),
