(243, 1, '2018-06-28 16:35:54', '2018-06-28 19:35:54', 'Organizada pelo COI (Comitê Olímpico Internacional), os primeiros jogos de inverno aconteceram em 1924, na cidade de Chamonix, na França com a participação de 258 atletas de 16 países diferentes, entre eles 247 homens e 11 mulheres.\r\n\r\nPor algum tempo, os jogos de verão e inverno eram realizados no mesmo país, mas com os ventos da Segunda Guerra Mundial, duas edições foram canceladas e somente após o término desses eventos, os jogos eram realizados em sedes diferentes, porém no mesmo ano.\r\n\r\nEm 1986, as Olímpiadas de verão e inverno passaram a acontecer de forma intercalada, com uma pausa de dois anos entre as duas competições.\r\n\r\nA primeira participação do Brasil ocorreu nos jogos de 1992, na França. Nosso comitê contou com 7 atletas, todos atuando pela modalidade do Esqui Alpino. Desde então, o Brasil vem aumentando sua participação e na última edição conto com 9 atletas. Aparentemente, nosso país tropical começou a desbravar cada vez mais lugares gelados.\r\n\r\n&nbsp;', 'História dos jogos de inverno', '', 'publish', 'closed', 'closed', '', 'historia-dos-jogos-de-inverno', '', '', '2018-06-28 16:35:54', '2018-06-28 19:35:54', '', 0, 'https://atletasnow.com/?post_type=aprenda&#038;p=243', 0, 'aprenda', '', 0),
(244, 1, '2018-06-28 16:38:28', '2018-06-28 19:38:28', 'O que antes era considerado apenas diversão ou entretenimento, hoje conta com campeonatos de elite espalhados por todo o globo, jogadores de alto nível e grandes quantias de premiações.\r\nOs campeonatos de jogos eletrônicos ganharam destaque abrindo espaço na grade de grandes emissoras.\r\n\r\nA TV Globo possui o programa Zero1, comandado por Tiago Leifert, o apresentador recebe convidados especiais para analisar os principais eventos do mundo dos games e repercutir os campeonatos de “esports”. O canal Esporte Interativo, dedica um tempo para o mesmo assunto com o EI Games não somente em seu canal por assinatura, mas também em mídias como Twitter e principalmente Youtube, assim como o site dos canais ESPN que possuem transmissões e uma sessão exclusiva sobre o tema em seu site.\r\n\r\nTalvez você possa argumentar dizendo que não existe grande esforço físico para competir na modalidade e ser considerado esporte, mas com equipes cada vez mais qualificadas que representam nosso país em nível global, esteja na hora de rever seus conceitos e apoiar esses atletas.\r\n\r\nPensando nesses competidores, a AtletasNow já possui seu espaço para Gamers adicionarem seu perfil.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA', 'Videogame é esporte sim!', '', 'publish', 'closed', 'closed', '', 'videogame-e-esporte-sim', '', '', '2018-06-28 16:38:28', '2018-06-28 19:38:28', '', 0, 'https://atletasnow.com/?post_type=aprenda&#038;p=244', 0, 'aprenda', '', 0),
