(261, 1, '2018-07-06 09:39:30', '2018-07-06 12:39:30', 'Bernardinho, vitorioso treinador de vôleibol, é conhecido por seu jeito explosivo e energético dentro das quadras.\r\n\r\nAcreditamos que alguém com tanta bagagem, tenha muito conhecimento para compartilhar com públicos de diversas idades, por isso, separamos um vídeo no qual o professor fala sobre como construir times de alto rendimento\r\n\r\n&nbsp;\r\n\r\nhttps://www.youtube.com/watch?v=K8AlIqBhX0A&amp;t=121s\r\n\r\n&nbsp;\r\n\r\n<strong>Fonte:</strong> <strong>Orador:</strong> Bernardinho.\r\n<strong>Canal:</strong> Endeavor Brasil', 'Palavras de quem sabe - Bernardinho', '', 'publish', 'closed', 'closed', '', 'https-www-youtube-com-watchvk8aliqbhx0a', '', '', '2018-07-06 10:36:27', '2018-07-06 13:36:27', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=261', 0, 'aprenda', '', 0),
