(273, 1, '2018-07-10 16:38:37', '2018-07-10 19:38:37', 'O que passa na cabeça dos atletas?\r\n\r\nO TED TALK é uma série de conferências, sem fins lucrativos, que possui o intuito de espalhar e debater ideias. Os temas são os mais variados possíveis, sempre contanto com a presença de algum profissional que seja referência no assunto debatido.\r\nNo vídeo que separamos, o psicólogo Martin Hagger explica ao longo da conversa, técnicas que atletas e técnicos utilizam para se preparem psicologicamente antes de competirem para atingirem grandes performances.\r\n\r\nhttps://www.youtube.com/watch?v=yG7v4y_xwzQ\r\n\r\n&nbsp;\r\n\r\n<strong>Fonte: </strong>Canal – TED X TALKS\r\nOrador – Martin Hagger <strong>\r\n</strong>Tradução: Brescia Terra\r\nRevisão: Pedro Reis\r\n\r\n<strong>\r\n\r\n\r\n</strong>\r\n\r\n&nbsp;', 'Na Cabeça dos Campeões', '', 'publish', 'closed', 'closed', '', 'na-cabeca-dos-campeoes', '', '', '2018-07-10 16:39:17', '2018-07-10 19:39:17', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=273', 0, 'aprenda', '', 0),
