(279, 1, '2018-07-12 14:16:31', '2018-07-12 17:16:31', 'Antes do Jogos Olímpicos começarem, a Tocha Olímpica precisa ser acesa para oficializar o início da competição. A Chama percorre um grande trajeto passando por cidades e pelas mãos de convidados que vão conduzi-la até seu destino.\r\nOs Jogos Olímpicos começaram na cidade de Olímpia, na Grécia antiga, por isso, receberam este nome. Os Gregos consideravam o fogo como algo divino, então acendiam chamas nas portas dos templos e, na naquela época, mensageiros percorriam cidades para anunciar que a data de início da competição estava se aproximando. Além disso, os Jogos marcavam um período de paz entre os povos.\r\nEsses acontecimentos marcaram o que podemos chamar de “Jogos Olímpicos da Antiguidade” explicando suas origens e tradições. Na era moderna, na cidade de Amsterdã, em 1928, foi a primeira edição a ter uma Pira Olímpica acesa em um dos seus estádios. Na edição de Berlim, em 1936, foi realizado o primeiro revezamento da Tocha Olímpica que percorreu sete países antes de chegar na cidade que recebeu os Jogos naquele ano.\r\nAo longo do tempo, a Tocha recebeu algumas modificações no seu design para não apagar ao longo do caminho, independente da condição climática. Mas, ela nunca perdeu seu real significado, ou seja, simbolizar o espírito de paz ao longo da competição.\r\n\r\nNós da AtletasNow, acreditamos que o esporte, de fato, é capaz de conectar diferentes culturas e queremos que o espírito esportivo esteja cada vez mais presente em todos os lugares para qualquer modalidade esportiva.', 'A Tocha Olímpica e seu verdadeiro significado.', '', 'publish', 'closed', 'closed', '', 'a-tocha-olimpica-e-seu-verdadeiro-significado', '', '', '2018-07-12 14:16:31', '2018-07-12 17:16:31', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=279', 0, 'aprenda', '', 0),
(280, 1, '2018-07-12 17:02:12', '2018-07-12 20:02:12', 'Gustavo Kuerten, mais conhecido como Guga, sem dúvidas é uma inspiração para todos os esportistas. Além de uma trajetória vitoriosa, seu carisma e palavras podem contagiar uma arena inteira.\r\nSeparamos uma palestra do grande jogador na qual ele conta os bastidores das suas competições e muitas histórias pessoais capaz de despertar o espirito campeão de qualquer pessoa.\r\n\r\nhttps://www.youtube.com/watch?v=e-t8Gtq7Jr8\r\n\r\nFonte: Canal: Canal Oficial Guga Kuerten\r\nOrador: Guga\r\nOnde: Palestra Endeavor.', 'Bastidores do sucesso.', '', 'publish', 'closed', 'closed', '', 'bastidores-do-sucesso', '', '', '2018-07-12 17:02:37', '2018-07-12 20:02:37', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=280', 0, 'aprenda', '', 0),
