(300, 1, '2018-07-16 15:15:07', '2018-07-16 18:15:07', 'Daniel Dias:\r\n\r\n&nbsp;\r\n\r\nEntre as raias de uma piscina, é onde nosso maior atleta Paralímpico, Daniel Dias, costuma esbanjar seu talento.\r\nDaniel de Faria Dias nasceu no dia 24 de maio de 1988 com uma má formação Congênita nos braços e na perna direita. Desde pequeno, o nadador sempre possuiu interesse por esportes e gostava de praticar alguma atividade física na época da escola. Porém, foi em 2004, nos Jogos Paralímpicos de Atenas, que surgiu o sonho de representar seu país quando viu outro atleta, Clodoaldo Silva, brilhar nas águas e levar seis medalhas de ouro. Nessa edição, Daniel pôde conhecer e se interessar pela modalidade dando início na sua trajetória como atleta.\r\nNo ano de 2006, ele participou da sua primeira competição oficial e de cara faturou duas medalhas de bronze, mas foi no final do ano, na África do Sul, onde o atleta conquistou o lugar mais alto do pódio.\r\nEm 2008, nos Jogos de Pequim, Daniel fez sua estreia nos Jogos competindo nas categorias S5, SB4 e SM5 fechando a competição com quatro medalhas de ouro, quatro pratas e um bronze. Na edição seguinte, em Londres, ele obteve sucesso em todas modalidades que participou faturando incríveis seis medalhas de ouro.\r\nNos jogos do Rio de Janeiro, em 2016, Daniel chegou na competição somando quinze medalhas no currículo, o que já podemos considerar algo impressionante. Mas, o campeão nunca parou de nos surpreender e terminou a competição com quatro medalhas de ouro, três de prata e duas de bronze, somando vinte e quatro medalhas na carreira.\r\nAtualmente, Daniel continua escrevendo sua história competindo em diversas competições, além de realizar palestras sobre superação e propagar o esporte Paralímpico no país.\r\nNão basta colecionar diversas medalhas, o atleta também é um exemplo de pessoa que, sem dúvida, vai continuar brilhando por onde competir.\r\n\r\n&nbsp;\r\n\r\nNós queremos compartilhar histórias dos mais diversos atletas para mostrar o quanto eles são importantes para o esporte nacional e internacional. Você gostou do atleta dessa semana? gostaria de sugerir algum campeão para aparecer neste quadro?\r\nQueremos saber sua sugestão, então corre para nossas redes sociais e fale de alguém que pode aparecer aqui semana que vem.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA', 'Pouca Mídia, Muito Talento!', '', 'publish', 'closed', 'closed', '', 'pouca-midia-muito-talento-2', '', '', '2018-07-16 16:26:16', '2018-07-16 19:26:16', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=300', 0, 'aprenda', '', 0),
(301, 1, '2018-07-16 15:27:09', '2018-07-16 18:27:09', 'Daniel Dias:\n\nEntre as raias de uma piscina, é onde nosso maior atleta Paralímpico, Daniel Dias, costuma esbanjar seu talento.\nDaniel de Faria Dias nasceu no dia 24 de maio de 1988 com uma má formação Congênita nos braços e na perna direita. Desde pequeno, o nadador sempre possuiu interesse por esportes e gostava de praticar alguma atividade física na época da escola. Porém, foi em 2004, nos Jogos Paralímpicos de Atenas, que surgiu o sonho de representar seu país quando viu outro atleta, Clodoaldo Silva, brilhar nas águas e levar seis medalhas de ouro. Nessa edição, Daniel pode conhecer e se interessar pela modalidade dando início na sua trajetória como atleta.\nNo ano de 2006, ele participou da sua primeira competição oficial e de cara faturou duas medalhas de bronze, mas foi no final do ano, na África do Sul, onde o atleta conquistou o lugar mais alto do pódio nos 100m livres, 200m medley e no revezamento 4x50m livre 20pnts.\nEm 2008, nos Jogos de Pequim, Daniel fez sua estreia nos Jogos competindo nas categorias S5, SB4 e SM5 fechando a competição com quatro medalhas de ouro, quatro pratas e um bronze. Na edição seguinte, em Londres, ele obteve sucesso em todas modalidades que participou faturando incríveis seis medalhas de ouro.\nNos jogos do Rio de Janeiro, em 2016, Daniel chegou na competição somando quinze medalhas no currículo, o que já podemos considerar algo impressionante. Mas, o campeão nunca parou de nos surpreender e terminou a competição com quatro medalhas de ouro, três de prata e duas de bronze, somando vinte e quatro medalhas na carreira.\nAtualmente, Daniel continua escrevendo sua história competindo em diversas competições, além de realizar palestras sobre superação e propagar o esporte Paralímpico no país.\nNão basta colecionar diversas medalhas, o atleta também é um exemplo de pessoa que, sem dúvida, vai continuar brilhando por onde competir.\n\nNós queremos compartilhar histórias dos mais diversos atletas para mostrar o quanto eles são importantes para o esporte nacional e internacional. Você gostou do atleta dessa semana? gostaria de sugerir algum campeão para aparecer neste quadro?\nQueremos saber sua sugestão, então corre para nossas redes sociais e fale de alguém que pode aparecer aqui semana que vem.\n\n#ATLETASNOWSUAHORAÉAGORA', 'Pouca Mídia, Muito Talento!', '', 'inherit', 'closed', 'closed', '', '300-autosave-v1', '', '', '2018-07-16 15:27:09', '2018-07-16 18:27:09', '', 300, 'https://atletasnow.com/app/sem-categoria/300-autosave-v1/', 0, 'revision', '', 0),
(303, 1, '2018-07-16 15:55:49', '2018-07-16 18:55:49', 'Bom, talvez a expressão correta ainda pode gerar dúvidas entre muitas pessoas, mas o termo correto (ou definido) é <strong>Paralímpico.\r\n</strong>Não entendeu muito bem? Deixa que a gente explica melhor:\r\nNo final de 2011, o Comitê Olímpico Internacional (COI) modificou o nome para Paralímpico como forma de todos os países se alinharem e utilizarem a mesma linguagem, surgindo o Comitê Paralímpico Internacional. O prazo para todas as instituições se adaptarem e modificarem para Paralímpico foi de um ano.\r\nEm 2016, nos Jogos do Rio, o Brasil adotou o novo termo para se alinhar com todos os outros países, seguindo a orientação do Comitê. Naquele ano, quando o logo oficial foi apresentado, já podíamos ler “Jogos Paralímpicos”\r\nPortanto, na próxima vez que você ler “<strong>Paralímpico</strong>”, quem digitou ou escreveu a palavra não esqueceu do “O” na palavra, apenas adotou a nova medida.<strong>\r\n\r\n</strong>', 'Afinal: devemos falar Paraolímpico ou Paralímpico?', '', 'publish', 'closed', 'closed', '', 'afinal-devemos-falar-paraolimpico-ou-paralimpico', '', '', '2018-07-16 15:55:49', '2018-07-16 18:55:49', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=303', 0, 'aprenda', '', 0),
(305, 1, '2018-07-17 11:42:06', '2018-07-17 14:42:06', 'Hortência de Fátima Marcari ou apenas Hortência é considerada uma das maiores jogadoras de basquete de todos os tempos. A jogadora é a maior pontuadora da história da seleção, somando incríveis 3.160 pontos, marcados em 127 partidas. Em 2002, todo seu talento a levou ao Hall da Fama do Basquetebol Feminino, nos Estados Unidos e, em 2005,  do Naismith Memorial Basketball Hall of Fame.\r\nSeparamos uma entrevista na qual a jogadora fala sobre sua trajetória, passa todo seu conhecimento e ressalta a importância de amar sua profissão para sempre se manter motivado(a) todos os dias.\r\n\r\n&nbsp;\r\n\r\nhttps://www.youtube.com/watch?v=LF_ZwS-Npt4\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #000000; font-family: Calibri;\"><strong>Fonte: </strong>\r\nCanal - Foras de Série.\r\nEntrevistada - Hortência| Ex-Jogadora de Basquete.</span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Uma gigante entre nós', '', 'publish', 'closed', 'closed', '', 'uma-gigante-entre-nos', '', '', '2018-07-17 11:42:24', '2018-07-17 14:42:24', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=305', 0, 'aprenda', '', 0),
(307, 1, '2018-07-17 11:42:15', '2018-07-17 14:42:15', '<iframe width=\"846\" height=\"476\" src=\"https://www.youtube.com/embed/LF_ZwS-Npt4?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '', '', 'publish', 'closed', 'closed', '', '9426bb34764d5500c9c096e5b7dc2479', '', '', '2018-07-17 11:42:15', '2018-07-17 14:42:15', '', 0, 'https://atletasnow.com/app/sem-categoria/9426bb34764d5500c9c096e5b7dc2479/', 0, 'oembed_cache', '', 0),
(308, 1, '2018-07-17 12:28:20', '2018-07-17 15:28:20', 'Os cartões amarelos e vermelhos são utilizados para advertir os jogadores de futebol seja por alguma jogada mais violenta, agressão ou discussão contra seu adversário. Porém, o futebol não nasceu com os cartões como forma de sinalizar uma falta, então com o passar do tempo foi necessário criar uma linguagem (ou sinal) universal para os jogadores entenderem essa punição.\r\nTudo começou em 1966 com o polêmico jogo entre Inglaterra e Argentina. Na ocasião, o capitão argentino Rattín questionou uma falta marcada pelo árbitro alemão Rudolf Kreitlein, mas como o juiz não entendia espanhol, utilizou seu dedo para sinalizar a expulsão do jogador de campo diante de uma reclamação mais exaltada.\r\nContudo, existia uma falha de comunicação em campo com um árbitro alemão, jogadores argentinos e os ingleses que, naquele ano, eram a seleção anfitriã.\r\nO chefe dos árbitros recebeu a missão de solucionar o problema para a próxima edição do mundial. A inspiração surgiu quando a caminho do estádio, dentro de um táxi, percebeu que no sinal amarelo o motorista reduzia a velocidade, e no vermelho parava imediatamente. Em 1970, na Copa do México, os cartões foram introduzidos ao jogo com amarelo para advertência e vermelho para expulsão, logo a “simples” invenção se tornou uma linguagem universal entre árbitros e jogadores.\r\nAgora, imagine como seria o futebol sem os cartões nos dias de hoje?\r\n\r\nA equipe da AtletasNow acredita que as histórias que construíram o mundo dos esportes são muito importantes para entendermos como as regras e jogos são aplicados atualmente, por isso, toda semana vamos trazer novas histórias para vocês. Se quiser sugerir alguma outra história, comente em nossas redes sociais.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA', 'Foi lance para cartão?', '', 'publish', 'closed', 'closed', '', 'foi-lance-para-cartao', '', '', '2018-07-17 12:30:15', '2018-07-17 15:30:15', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=308', 0, 'aprenda', '', 0),
