(322, 1, '2018-07-18 16:53:41', '2018-07-18 19:53:41', 'Maria Lenk  - 1ª Brasileira a participar dos Jogos Olímpicos:\r\n\r\n&nbsp;\r\n\r\nForam das raias das piscinas que emergiu a primeira mulher a disputar os Jogos Olímpicos pelo Brasil. Maria Emma Hulga Lenk Zigler ou Maria Lenk, foi pioneira para a natação feminina.\r\nEla começou cedo no esporte, conquistou títulos nacionais nadando pelo Flamengo e,\r\ncom apenas 17 anos, a nadadora embarcou com a federação composta por homens e uma única mulher para os Jogos Olímpicos na cidade de Los Angeles, em 1932.\r\nEm sua estreia, ela competiu em três provas: os 100m livres, 100m costas e 200m peito. A debutante não conquistou medalhas, mas sua participação foi um marco em uma época na qual a presença feminina não era comum.\r\nEla participou de outras edições dos jogos e outros campeonatos de natação, quebrou recordes mundiais nos 400m e 200m e fora das piscinas, em 1942, ajudou na fundação da Escola Nacional de Educação Física da Universidade do Brasil, UFRJ, no Rio de Janeiro. Escreveu o livro “Longevidade e Esporte” falando dos benefícios da natação para seus praticantes e chegou ao Hall da Fama da federação internacional de Natação.\r\nInfelizmente, faleceu no ano de 2007 enquanto nadava na piscina do Flamengo devido uma parada cardiorrespiratória.\r\nCom toda essa bagagem e por tudo que Maria Lenk fez pelo esporte, não somente podemos dizer que ela fez história, mas se tornou uma lenda do país!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Pouca Mídia, Muito Talento!', '', 'publish', 'closed', 'closed', '', 'pouca-midia-muito-talento-3', '', '', '2018-07-23 15:33:37', '2018-07-23 18:33:37', '', 0, 'https://atletasnow.com/app/?post_type=aprenda&#038;p=322', 0, 'aprenda', '', 0),
