(333, 1, '2018-07-20 10:29:27', '2018-07-20 13:29:27', 'O mundo dos esportes além de nos proporcionar momentos incríveis e emocionantes, também pode nos ensinar muito. Por isso, separamos uma lista que todo admirador do esporte não pode deixar de ter em sua coleção:\n\n&nbsp;\n\nGuga, um brasileiro\n\nGuga é uma referência para o esporte brasileiro e um dos maiores atletas da história do tênis.\nSempre muito carismático, seu talento e dedicação foram compensados com uma trajetória de sucesso e muitas conquistas. Este livro mostra os bastidores de sua carreira desde o início, glórias e momentos que precisou lidar com lesões mostrando toda sua superação.\n\n&nbsp;\n\nOscar Schmidt: 14 Motivos Para Viver, Vencer e Ser Feliz\n\nOscar nunca jogou a NBA, mas atingiu um feito que poucos atletas conseguem: chegou ao Hall da Fama do Basquete. No livro, o ex-jogador compartilha suas histórias de como se tornou um atleta campeão e usa sua dedicação para vencer todos os obstáculos.\n\n&nbsp;\n\nAlex Ferguson: Liderança\n\nAlex Ferguson treinou o Manchester United por muitos anos conquistando todos os títulos possíveis, além de treinar e revelar craques ao longo desses anos. A obra traz os segredos do treinador, o que é necessário para construir equipes de alto rendimento, como lidar com o fracasso e como alcançar o sucesso.\n\n&nbsp;\n\nMarketing Esportivo - Uma Visão Estratégica e Atual\n\nVoltado para os negócios por trás dos esportes, o livro apresenta conceitos de Marketing aplicados no mundo esportivo e estratégias inovadoras para este mercado englobando as mais diversas modalidades.\n\n&nbsp;\n\n&nbsp;\n\nGostou das nossas dicas? Gostaria de recomendar outro livro? Comente em nossas redes sociais algum livro para que todos os amantes do esporte possam ler, se divertir e aprender.\n\n&nbsp;\n\n&nbsp;\n\n#ATLETASNOWSUAHORAÉAGORA', 'Livros que você não pode deixar de ler!', '', 'inherit', 'closed', 'closed', '', '327-autosave-v1', '', '', '2018-07-20 10:29:27', '2018-07-20 1