(28836, 1971, 'biography', 'Olá, meu nome é Alysson Patrike, tenho 18 anos, sou do ano de 2000,tenho 1,90 de altura,jogo de oposto e ponteiro passador porém tenho plena disposição para mudar de função, provavelmente jogarei sub-21 na sua equipe, sou sonhador, esforcado,amo esse esporte chamado voleibol, mesmo sendo da regiao norte do pais e não sendo tão novo assim, tenho a fé em Deus que vou chegar a seleção brasileira, se você treinador quiser saber mais da minha história entre em contato, me ajudem, tudo as vezes que as pessoas precisam é uma oportunidade.'),
