(29821, 1982, 'biography', 'A Associação Atlética Acadêmica Unifesp Osasco (AAAUO) é a entidade que representa e organiza as atividades esportivas da EPPEN-UNIFESP (Escola Paulista de Política, Economia e Negócios da Universidade Federal de São Paulo - campus Osasco), tendo como objetivo promover o lazer e o bem-estar dos estudantes por meio da difusão e incentivo da prática esportiva.\r\nAlém de trabalharmos em prol da inclusão de todos os alunos no corpo de atletas, objetivando o desenvolvimento do espírito esportivo universitário, é também parte de nossa responsabilidade promover a integração da comunidade universitária com a comunidade local, incentivando a cultura acadêmica por meio de projetos e realizações com outras instituições e entidades.'),
